typedef struct rgba_t
{
    float r, g, b, a;
} rgba;

void select_material(long matno)
{
struct Material *m = &all_materials[matno];
rgba diffuse, ambient, emissive, specular;

	diffuse.r = m->diffuse[0];
	diffuse.g = m->diffuse[1];
	diffuse.b = m->diffuse[2];
	diffuse.a = 1.0f - m->transparency;

	ambient.r = m->ambient[0];
	ambient.g = m->ambient[1];
	ambient.b = m->ambient[2];
	ambient.a = 1.0f - m->transparency;

	emissive.r = m->emissive[0];
	emissive.g = m->emissive[1];
	emissive.b = m->emissive[2];
	emissive.a = 1.0f;

	specular.r = m->specular[0];
	specular.g = m->specular[1];
	specular.b = m->specular[2];
	specular.a = 1.0f;

	glMaterialfv(GL_FRONT_AND_BACK, GL_DIFFUSE, (float*)&diffuse);
	glMaterialfv(GL_FRONT_AND_BACK, GL_AMBIENT, (float *)&ambient);
	glMaterialfv(GL_FRONT_AND_BACK, GL_EMISSION, (float *)&emissive);
	glMaterialfv(GL_FRONT_AND_BACK, GL_SPECULAR, (float *)&specular);
	glMaterialfv(GL_FRONT_AND_BACK, GL_SHININESS, (float *)&m->shininess);

	if (diffuse.a < 1.0f )
		{
		glBlendFunc(GL_SRC_ALPHA, GL_ONE_MINUS_SRC_ALPHA);
		glEnable(GL_BLEND);
		}
	else
		glDisable(GL_BLEND);
}

