///////////////////////////////////////////////
void initPetalArray(void)
{
  for(int i = 0; i < MAX_NO_OF_PETALS; i++)
  {
    petalArray[i].x = (myRandom() - 0.5) * 1.5; //both sides of rose
    if (myRandom() > 0.5 )
      petalArray[i].y = myRandom() * 6.9; //height
    else
      petalArray[i].y = myRandom() * -20;
    petalArray[i].z =  (myRandom() - 0.5) * 1.5; //both sides of rose
    petalArray[i].age = 0;
    petalArray[i].rotateAngley = myRandom();
    petalArray[i].rotateAnglex = myRandom();
  }
}
///////////////////////////////////////////////
void drawPetal(i)
{
  //for drawing the circle
  double angle = 2.0f *  3.1416f/100 ;
  glClear(GL_DEPTH_BUFFER_BIT);
  //delete petal when too far or too old
  if(((petalArray[i].age > lifeExpectacy || petalArray[i].y < -20 )&& inverseGravity == 0) ||
    ((petalArray[i].age > lifeExpectacy || petalArray[i].y > 20 )&& inverseGravity == 1))
  {
    petalArray[i].y =  6.9;
    petalArray[i].x =  (myRandom() - 0.5) * 1.5;
    petalArray[i].age = 0;
    petalArray[i].rotateAngley = myRandom();
    petalArray[i].rotateAnglex = myRandom();
  }
  //if wind mode modify along x axis
  if (windMode == 1)
    petalArray[i].x =  petalArray[i].x + 0.1;
  // place petal randomly around the top of the rose
  glTranslatef(petalArray[i].x, petalArray[i].y, petalArray[i].z);
  // rotate petal around its y and x axis
  petalArray[i].rotateAngley = petalArray[i].rotateAngley + (petalArray[i].age/3);
  glRotatef( petalArray[i].rotateAngley, 0.0, 1.0, 0.0);
  petalArray[i].rotateAnglex = petalArray[i].rotateAnglex + (petalArray[i].age/3);
  glRotatef( petalArray[i].rotateAnglex, 1.0, 0.0, 0.0);
  // draw the petals
  glPolygonMode(GL_FRONT, GL_FILL);
  glColor3f(1.0, 1.0, 1.0);
  glBegin(GL_POLYGON);
    double angle1 = 0.0;
    glVertex2d( circleRadius * cos(0.0) , circleRadius * sin(0.0));
    int j;
    for (j = 0; j < 100; j++)
    {
      glVertex2d(circleRadius * cos(angle1), circleRadius *sin(angle1));
      angle1 += angle ;
    }
  glEnd();

  //if inverseGravity mode move upwards
  if (inverseGravity == 0)
    petalArray[i].y = petalArray[i].y - petalSpeed;
  else //move downwards
    petalArray[i].y = petalArray[i].y + petalSpeed;
  //keep count of petal's age
  petalArray[i].age = petalArray[i].age + 0.1;
}
///////////////////////////////////////////////
//calls to draw each petal
void petalFlow(void)
{
  for (int i= 0; i < noOfParticles; i++)
  {
    glPushMatrix();
      drawPetal(i);
    glPopMatrix();
  }
}
