void menu (int menuentry) {
  switch (menuentry) {
  case 1: current_view= NORMAL_VIEW;
          break;
  case 2: current_view= TOP_VIEW;
          break;
  case 3: current_view= FRONT_VIEW;
          break;
  case 4: if (inverseGravity == 1)
            inverseGravity = 0;
          else
            inverseGravity = 1;
          break;
  case 7: if (windMode == 1)
            windMode = 0;
          else
            windMode = 1;
          break;
  case 9: current_view = FLY_VIEW;
          break;
  case 8: exit(0);
  }
}

